/* Manager 系统管理/管理员信息管理 */

// ==================
// 所需的各种插件
// ==================

import React from 'react';
import { connect } from 'react-redux';
import { bindActionCreators } from 'redux';
import P from 'prop-types';

//import './index.scss';
import tools from '../../../../util/tools'; // 工具
import Power from '../../../../util/power'; // 权限
import { power } from '../../../../util/data';
// ==================
// 所需的所有组件
// ==================

import { Form, Button, Icon, Input, Table, message, Popconfirm, Modal, Radio, InputNumber, Select, Tooltip, Divider, Cascader  } from 'antd';
import RoleTree from '../../../../a_component/roleTree';    // 角色树 用于选角色

// ==================
// 本页面所需action
// ==================

import { findAdminUserByKeys, addAdminUserInfo, deleteAdminUserInfo, updateAdminUserInfo, findAllRole, findAllRoleByUserId, assigningRole, findAllOrganizer, findAllProvince, findCityOrCounty, findStationByArea } from '../../../../a_action/sys-action';

// ==================
// Definition
// ==================
const FormItem = Form.Item;
const RadioGroup = Radio.Group;
const { TextArea } = Input;
const Option = Select.Option;
class Manager extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [], // 当前页面全部数据
      searchUserName: '',
      searchConditions: null,
      addnewModalShow: false, // 添加新用户 或 修改用户 模态框是否显示
      addnewLoading: false, // 是否正在添加新用户中
      nowData: null, // 当前选中用户的信息，用于查看详情
      orgCodeValue: null, // 新增、修改 - 选择的组织部门对象
      queryModalShow: false, // 查看详情模态框是否显示
      upModalShow: false, // 修改用户模态框是否显示
      upLoading: false, // 是否正在修改用户中
      roleTreeShow: false, // 角色树是否显示
      pageNum: 1, // 当前第几页
      pageSize: 10, // 每页多少条
      total: 0, // 数据库总共多少条数据
      addOrUp: 'add',   // 当前操作是新增还是修改
      citys: [],    // 所有的省
      stations: [],   // 当前服务站地区所对应的服务站
    };
  }

  componentDidMount() {
      // 现在组织结构写死的，暂时不用，但接口保留
      // if((!this.props.allOrganizer) || (!this.props.allOrganizer.length)) {
      //     this.getAllOrganizer();
      // }
      if (!this.props.citys.length) { // 获取所有省，全局缓存
          this.getAllCity0();
      } else {
          this.setState({
              citys: this.props.citys.map((item, index) => ({ id: item.id, value: item.areaName, label: item.areaName, isLeaf: false})),
          });
      }
    this.onGetData(this.state.pageNum, this.state.pageSize);
  }

    componentWillReceiveProps(nextP) {
        if(nextP.citys !== this.props.citys) {
            this.setState({
                citys: nextP.citys.map((item, index) => ({ id: item.id, value: item.areaName, label: item.areaName, isLeaf: false})),
            });
        }
    }

    // 获取所有的省
    getAllCity0() {
        this.props.actions.findAllProvince();
    }


    // 根据上级区域找下级区域  获取省下面所有的市
    getAllCitySon(selectedOptions) {
        console.log('SSS',selectedOptions);
        const targetOption = selectedOptions[selectedOptions.length - 1];
        targetOption.loading = true;
        this.props.actions.findCityOrCounty({ parentId: selectedOptions[selectedOptions.length - 1].id }).then((res) => {
            if (res.returnCode === '0') {
                targetOption.children = res.messsageBody.map((item, index) => {
                    return { id: item.id, value: item.areaName, label: item.areaName, isLeaf: item.level === 2, key: index };
                });
            }
            targetOption.loading = false;
            this.setState({
                citys: [...this.state.citys]
            });
        });
    }

    //工具 - 根据服务站地区返回省
    getProvinceStationId(id) {
        const t = this.state.stations.find((item) => String(item.id) === String(id));
        return t ? t.province : '';
    }

    //工具 - 根据服务站地区返回市
    getCityStationId(id) {
        const t = this.state.stations.find((item) => String(item.id) === String(id));
        return t ? t.city : '';
    }

    //工具 - 根据服务站地区返回区
    getRegionStationId(id) {
        const t = this.state.stations.find((item) => String(item.id) === String(id));
        return t ? t.region : '';
    }

    //工具 - 根据服务站地区返回服务站名称id
    getNameStationId(id) {
        const t = this.state.stations.find((item) => String(item.id) === String(id));
        return t ? t.name : '';
    }

  // 查询所有组织机构
    getAllOrganizer() {
        this.props.actions.findAllOrganizer();
    }

  // 查询当前页面所需列表数据
    onGetData(pageNum, pageSize) {
        const params = {
            userName: this.state.searchUserName,
            conditions: this.state.searchConditions,
            pageNum,
            pageSize,
        };

        this.props.actions.findAdminUserByKeys(tools.clearNull(params)).then((res) => {
            if(res.returnCode === "0") {
                this.setState({
                    data: res.messsageBody.result,
                    pageNum,
                    pageSize,
                    total: res.messsageBody.total,
                });
            } else {
                message.error(res.returnMessaage || '获取数据失败，请重试');
            }
        });
    }
  // 搜索 - 用户名输入框值改变时触发
    searchUserNameChange(e) {
      if (e.target.value.length < 20) {
          this.setState({
              searchUserName: e.target.value,
          });
      }
    }

    // 搜索 - 状态选择框值变化时调用
    searchConditions(e) {
      console.log('选择了什么：', e);
      this.setState({
          searchConditions: e || null,
      });
    }

   // 修改某一条数据 模态框出现
    onUpdateClick(record) {
      const me = this;
      const { form } = me.props;
      console.log('Record:', record);
        form.setFieldsValue({
            upUsername: record.userName,
            upPassword: '______',
            upSex: record.sex || 1,
            upAge: record.age || undefined,
            upPhone: record.phone || undefined,
            upEmail: record.email || undefined,
            upDescription: record.description || undefined,
            upConditions: record.conditions || "0",
            upOrgCode: record.orgCode || undefined,
            upServiceStation: undefined,
            upCascader: undefined,
        });
        form.resetFields([
            'upCitys',
            'upStationName',
            'upStationId'
        ]);
        me.setState({
            nowData: record,
            addOrUp: 'up',
            upModalShow: true,
        });
    }

    // 确定修改某一条数据
    onUpOk() {
      console.log('NOWDATA:', this.state.nowData);
      const me = this;
      const { form } = me.props;
      const isStation = form.getFieldValue('upOrgCode') === 18;   // 是否是服务站
      const check = [
          'upUsername',
          'upPassword',
          'upSex',
          'upAge',
          'upPhone',
          'upEmail',
          'upDescription',
          'upConditions',
          'upOrgCode',
          'upCitys',
          'upStationName',
          'upStationId',
      ];
      // 如果是服务站，并且原数据服务站信息为null,则必须当前选择一个服务站
        if(isStation && !String(this.state.nowData.stationId)){
            check.push('upServiceStation');
        }

        form.validateFields(check, (err, values) => {
            if(err) { return; }

            me.setState({
                upLoading: true,
            });
            console.log('ABCCCCC:', values.upServiceStation);
            const upServiceStation = form.getFieldValue('upServiceStation');
            const params = {
                id: me.state.nowData.id,
                userName: values.upUsername,
                password: values.upPassword === '______' ? null : values.upPassword,
                sex: values.upSex,
                age: values.upAge || '',
                phone: values.upPhone || '',
                email: values.upEmail || '',
                orgType: values.upOrgCode || '',
                description: values.upDescription || '',
                adminIp: '',
                conditions: values.upConditions || '0',
                stationId: isStation ? (upServiceStation ? upServiceStation.key : this.state.nowData.stationId) : '',
                stationName: isStation ? (upServiceStation ? upServiceStation.label : this.state.nowData.stationName) : '',
            };

            this.props.actions.updateAdminUserInfo(params).then((res) => {
                if (res.returnCode === "0") {
                    message.success("修改成功");
                    this.onGetData(this.state.pageNum, this.state.pageSize);
                    this.onUpClose();
                } else {
                    message.error(res.returnMessaage || '修改失败，请重试');
                }
                me.setState({
                    upLoading: false,
                });
            }).catch(() => {
                me.setState({
                    upLoading: false,
                });
            });
        });
    }
    // 关闭修改某一条数据
    onUpClose() {
        this.setState({
            upModalShow: false,
        });
    }

    // 删除某一条数据
    onDeleteClick(id) {
        this.props.actions.deleteAdminUserInfo({adminUserId: id}).then((res) => {
            if(res.returnCode === "0") {
                message.success('删除成功');
                this.onGetData(this.state.pageNum, this.state.pageSize);
            } else {
                message.error(res.returnMessaage || '删除失败，请重试');
            }
        });
    }

    // 搜索
    onSearch() {
        this.onGetData(1, this.state.pageSize);
    }

    // 查询某一条数据的详情
    onQueryClick(record) {
        this.setState({
            nowData: record,
            queryModalShow: true,
        });
    }

    // 查看详情模态框关闭
    onQueryModalClose() {
        this.setState({
            queryModalShow: false,
        });
    }

    // 添加新用户模态框出现
    onAddNewShow() {
      const me = this;
      const { form } = me.props;
      form.resetFields([
          'addnewUsername',
          'addnewPassword',
          'addnewSex',
          'addnewAge',
          'addnewPhone',
          'addnewEmail',
          'addnewDescription',
          'addnewOrgCode',
          'addCascader',
      ]);
        this.setState({
            addOrUp: 'add',
            addnewModalShow: true,
            orgCodeValue: null,
        });
    }

    // 添加新用户确定
    onAddNewOk() {
        const me = this;
        const { form } = me.props;
        const checks = [
            'addnewUsername',
            'addnewPassword',
            'addnewSex',
            'addnewAge',
            'addnewPhone',
            'addnewEmail',
            'addnewDescription',
            'addnewOrgCode',
        ];

        if([18].includes(this.state.code)){
            checks.push('addCascader')
        }

        if (form.getFieldValue('addnewOrgCode') === 18) {   // 有服务站的情况
            checks.push('addnewServiceStation');
        }

        form.validateFields(checks, (err, values) => {
            console.log('都返回的是什么；', values);
            if (err) { return false; }
            me.setState({
                addnewLoading: true,
            });
            const params = {
                userName: values.addnewUsername,
                password: values.addnewPassword,
                sex: values.addnewSex,
                age: values.addnewAge || '',
                phone: values.addnewPhone || '',
                email: values.addnewEmail || '',
                orgType: values.addnewOrgCode || '',
                description: values.addnewDescription || '',
                adminIp: '',
                conditions: '0',
                stationId: values.addnewServiceStation ? values.addnewServiceStation.key : null,
                // stationName: values.addnewServiceStation ? values.addnewServiceStation.label : null,
                stationName:this.getNameStationId(String(values.addnewStationId)),
                province:this.getProvinceStationId(String(values.addnewStationId)),
                city:this.getCityStationId(String(values.addnewStationId)),
                region:this.getRegionStationId(String(values.addnewStationId)),
            };

            me.props.actions.addAdminUserInfo(tools.clearNull(params)).then((res) => {
                console.log('添加用户返回数据：', res);
                if (res.returnCode === '0') {
                    this.onGetData(this.state.pageNum, this.state.pageSize);
                    this.onAddNewClose();
                } else {
                    message.error(res.returnMessaage || '添加失败，请重试');
                }
                me.setState({
                    addnewLoading: false,
                });
            }).catch(() => {
                me.setState({
                    addnewLoading: false,
                });
            });
        });
    }

    // 添加新用户取消
    onAddNewClose() {
      this.setState({
          addnewModalShow: false,
      });
    }


    // 表单页码改变
    onTablePageChange(page, pageSize) {
      console.log('页码改变：', page, pageSize);
      this.onGetData(page, pageSize);
    }

    // 工具函数 - 根据组织结构ID查组织结构名称
    getNameForId(id) {
        // const t = this.props.allOrganizer.find((item) => String(item.id) === String(id));
        // return t ? t.dicValue : '';
        switch(String(id)) {
            case '1' : return '翼猫总部';
            case '18': return '服务站';
            case '19': return '总部财务';
            default: return '';
        }
    }

    // 构建字段
    makeColumns(){
        const columns = [
            {
                title: '序号',
                dataIndex: 'serial',
                key: 'serial',
            },
            {
                title: '用户名',
                dataIndex: 'userName',
                key: 'userName',
            },
            {
                title: '性别',
                dataIndex: 'sex',
                key: 'sex',
                render: (text, record) => {
                    return text !== null ? (text === 1 ? '男' : '女') : '';
                },
            },
            {
                title: '年龄',
                dataIndex: 'age',
                key: 'age',
            },
            {
                title: '电话',
                dataIndex: 'phone',
                key: 'phone',
            },
            {
                title: '邮箱',
                dataIndex: 'email',
                key: 'email',
            },
            {
                title: '组织',
                dataIndex: 'orgCode',
                key: 'orgCode',
                render: (text, record) => this.getNameForId(text)
            },
            {
                title: '状态',
                dataIndex: 'conditions',
                key: 'conditions',
                render: (text, record) => text === "0" ? <span style={{color: 'green'}}>启用</span> : <span style={{color: 'red'}}>禁用</span>
            },
            {
                title: '操作',
                key: 'control',
                width: 200,
                render: (text, record) => {
                    let controls = [];

                    controls.push(
                        <span key="0" className="control-btn green" onClick={() => this.onQueryClick(record)}>
                            <Tooltip placement="top" title="查看">
                                <Icon type="eye" />
                            </Tooltip>
                        </span>
                    );
                    controls.push(
                        <span key="1" className="control-btn blue" onClick={() => this.onUpdateClick(record)}>
                            <Tooltip placement="top" title="修改">
                                <Icon type="edit" />
                            </Tooltip>
                        </span>
                    );
                    controls.push(
                        <span key="2" className="control-btn blue" onClick={() => this.onRoleTreeShow(record)} >
                            <Tooltip placement="top" title="分配角色">
                                <Icon type="tool" />
                            </Tooltip>
                        </span>
                    );
                    text.id !== 1 && controls.push(
                        <Popconfirm key="3" title="确定删除吗?" onConfirm={() => this.onDeleteClick(record.id)} okText="确定" cancelText="取消">
                            <span className="control-btn red">
                                <Tooltip placement="top" title="删除">
                                    <Icon type="delete" />
                                </Tooltip>
                            </span>
                        </Popconfirm>
                    );
                    const result = [];
                    controls.forEach((item, index) => {
                        if (index) {
                            result.push(<Divider key={`line${index}`} type="vertical" />,);
                        }
                        result.push(item);
                    });
                    return result;
                },
            }
        ];
        return columns;
    }

    // 构建table所需数据
    makeData(data) {
        console.log('DATA:', data);
        if (!data){return []}
        return data.map((item, index) => {
            return {
                key: index,
                adminIp: item.adminIp,
                password: item.password,
                id: item.id,
                serial: (index + 1) + ((this.state.pageNum - 1) * this.state.pageSize),
                age: item.age,
                conditions: item.conditions,
                creator: item.creator,
                createTime: item.createTime,
                description: item.description,
                email: item.email,
                orgCode: item.orgType,
                phone: item.phone,
                sex: item.sex,
                updateTime: item.updateTime,
                updater: item.updater,
                userName: item.userName,
                control: item.id,
                stationId: item.stationId,
                stationName: item.stationName,
            }
        });
    }

    // 打开RoleTree
    onRoleTreeShow(data) {
        this.setState({
            nowData: data,
            roleTreeShow: true,
        });
    }
    // 关闭RoleTree
    onRoleTreeClose() {
        this.setState({
            roleTreeShow: false,
        });
    }

    // RoleTree确定
    onRoleTreeOk(arr) {
        console.log('选中了什么：', arr, this.state.nowData);
        const params = {
            userId: this.state.nowData.id,
            roles: arr.map((item) => item.id).join(','),
        };
        this.props.actions.assigningRole(params).then((res) => {
            if (res.returnCode === '0') {
                message.success('角色分配成功');
            } else {
                message.error(res.returnMessaage || '角色分配失败，请重试');
            }
        });
        this.onRoleTreeClose();
    }

    // 添加区域被改变  选择省市区后查询对应的服务站
    onAddCascader(e) {
        console.log('是什么:', e);
        const me = this;
        const { form } = me.props;
        form.resetFields(['addnewServiceStation', 'upServiceStation']);
        this.props.actions.findStationByArea({ province: e[0], city: e[1], region: e[2], pageNum: 0, pageSize: 9999 }).then((res) => {
            if (res.returnCode === '0') {
                this.setState({
                    stations: res.messsageBody.result,
                });
            }
        });
    }

    // 添加组织被改变
    onAddOrgCodeChange(data) {
        const me = this;
        const { form } = me.props;
        form.resetFields(['addnewServiceStation']);
        console.log('是什么组织: ',data.orgType)
    }
  render() {
      const me = this;
      const { form } = me.props;
      const { getFieldDecorator, getFieldValue } = form;
      const formItemLayout = {
          labelCol: {
              xs: { span: 24 },
              sm: { span: 6 },
          },
          wrapperCol: {
              xs: { span: 24 },
              sm: { span: 18 },
          },
      };
    const addOrgCodeShow = getFieldValue('addnewOrgCode') === 18;
    const upOrgCodeShow = getFieldValue('upOrgCode') === 18;
    // console.log('code是什么：', addOrgCodeShow);
    return (
      <div>
        <div className="system-search">
            <ul className="search-func"><li><Button type="primary" onClick={() => this.onAddNewShow()}><Icon type="plus-circle-o" />添加用户</Button></li></ul>
            <Divider type="vertical" />
                <ul className="search-ul">
                    <li>
                        <Input
                            placeholder="用户名"
                            onChange={(e) => this.searchUserNameChange(e)}
                            value={this.state.searchUserName}
                            onPressEnter={() => this.onSearch()}
                        />
                    </li>
                    <li>
                        <Select
                            style={{ width: '150px' }}
                            placeholder="用户状态"
                            allowClear
                            onChange={(e) => this.searchConditions(e)}
                        >
                            <Option value="0">启用</Option>
                            <Option value="-1">禁用</Option>
                        </Select>
                    </li>
                    <li><Button icon="search" type="primary" onClick={() => this.onSearch()}>搜索</Button></li>
                </ul>
        </div>
        <div className="system-table">
          <Table
