                                  }
                                  callback();
                              }}
                          ],
                      })(
                          <Input placeholder="用户名" />
                      )}
                  </FormItem>
                  <FormItem
                      label="密码"
                      {...formItemLayout}
                  >
                      {getFieldDecorator('addnewPassword', {
                          initialValue: undefined,
                          rules: [
                              {required: true, message: '请输入密码'},
                              { validator: (rule, value, callback) => {
                                  const v = value;
                                  if (v) {
                                      if (v.length > 12) {
                                          callback('最多输入12位字符');
                                      } else if (v.length < 6) {
                                          callback('密码至少6位字符');
                                      }else if (!tools.checkStr2(v)){
