                              {required: true, message: '请输入用户名'},
                              { validator: (rule, value, callback) => {
                                  const v = value;
                                  if (v) {
                                      if (v.length > 12) {
                                          callback('最多输入12位字符');
                                      } else if (!tools.checkStr2(v)){
                                          callback('只能输入字母、数字及下划线');
                                      }
                                  }
                                  callback();
                              }}
                          ],
                      })(
                          <Input placeholder="用户名" />
                      )}
                  </FormItem>
                  <FormItem
                      label="密码"
                      {...formItemLayout}
                  >
                      {getFieldDecorator('upPassword', {
                          initialValue: '______',
                          rules: [
                              {required: true, message: '请输入密码'},
                              { validator: (rule, value, callback) => {
                                  const v = value;
                                  if (v) {
                                      if (v.length > 12) {
                                          callback('最多输入12位字符');
                                      } else if (v.length < 6) {
                                          callback('密码至少6位字符');
                                      }else if (!tools.checkStr2(v)){
                                          callback('只能输入字母、数字及下划线');
                                      }
                                  }
                                  callback();
                              }}
                          ],
                      })(
                          <Input placeholder="密码" type="password"/>
                      )}
                  </FormItem>
                  <FormItem
                      label="性别"
                      {...formItemLayout}
                  >
                      {getFieldDecorator('upSex', {
                          rules: [],
                          initialValue: 1,
                      })(
                          <RadioGroup>
                              <Radio value={1}>男</Radio>
                              <Radio value={0}>女</Radio>
                          </RadioGroup>
                      )}
                  </FormItem>
                  <FormItem
                      label="年龄"
                      {...formItemLayout}
                  >
                      {getFieldDecorator('upAge', {
                          rules: [],
                          initialValue: undefined,
                      })(
                          <InputNumber min={1} max={99} />
                      )}
                  </FormItem>
                  <FormItem
                      label="电话"
                      {...formItemLayout}
                  >
                      {getFieldDecorator('upPhone', {
                          initialValue: undefined,
                          rules: [{ validator: (rule, value, callback) => {
                              const v = value;
                              if (v) {
                                  if (!tools.checkPhone(v)) {
                                      callback('请输入有效的手机号码');
                                  }
                              }
                              callback();
                          }}],
                      })(
                          <Input placeholder="请输入手机号码" />
                      )}
                  </FormItem>
                  <FormItem
                      label="邮箱"
                      {...formItemLayout}
                  >
                      {getFieldDecorator('upEmail', {
                          initialValue: undefined,
                          rules: [{ validator: (rule, value, callback) => {
                              const v = value;
                              if (v) {
                                  if (!tools.checkEmail(v)) {
                                      callback('请输入有效的邮箱地址');
                                  }
                              }
                              callback();
                          }}],
                      })(
                          <Input placeholder="请输入邮箱地址" />
                      )}
                  </FormItem>
                  <FormItem
                      label="组织"
                      {...formItemLayout}
                  >
                      {getFieldDecorator('upOrgCode', {
                          initialValue: undefined,
                          rules: [{required: true, message: '请选择组织'}],
                      })(
                          <Select placeholder="选择组织">
                              <Option value={1} >翼猫总部</Option>
                              <Option value={18} >服务站</Option>
                              <Option value={19} >总部财务</Option>
                          </Select>
                      )}
                  </FormItem>
                  <FormItem
                      label="服务站地区"
                      style={{ display: upOrgCodeShow ? 'block' : 'none' }}
                      {...formItemLayout}
                  >
                      <span style={{ color: '#888' }}>
                            {(this.state.nowData && this.state.nowData.province && this.state.nowData.city && this.state.nowData.region) ? `${this.state.nowData.province}/${this.state.nowData.city}/${this.state.nowData.region}` : null}
                        </span>
                      {getFieldDecorator('upCascader', {
                          initialValue: undefined,
                          rules:[{required :true ,message: '请选择服务站地区'}]
                      })(
                          <Cascader
                              // placeholder={this.state.nowData ? (this.state.nowData.stationId || '请选择服务站地区') : '请选择服务站地区'}
                              placeholder= '请选择服务站地区'
                              options={this.state.citys}
                              loadData={(e) => this.getAllCitySon(e)}
                              onChange={(e) => this.onAddCascader(e)}
                          />
                      )}
                  </FormItem>
                  <FormItem
                      label="服务站名称"
                      style={{ display: upOrgCodeShow ? 'block' : 'none' }}
                      {...formItemLayout}
                  >
                      {getFieldDecorator('upServiceStation', {
                          initialValue: undefined,
                          rules: [{required: true, message: '请选择服务站名称'}],
                      })(
                          <Select
                              labelInValue
                              placeholder={this.state.nowData ? (this.state.nowData.stationName || '请选择服务站名称') : '请选择服务站名称'}
                          >
                              {this.state.stations.map((item, index) => {
                                  return <Option value={item.id} key={index}>{ item.name }</Option>
                              })}
                          </Select>
                      )}
                  </FormItem>
                  <FormItem
                      label="描述"
                      {...formItemLayout}
                  >
                      {getFieldDecorator('upDescription', {
                          initialValue: undefined,
                          rules: [{ validator: (rule, value, callback) => {
                              const v = value;
                              if (v) {
                                  if (v.length > 100) {
                                      callback('最多输入100个字符');
                                  }
                              }
                              callback();
                          }}],
                      })(
                          <TextArea rows={4} autosize={{minRows: 2, maxRows: 6}} />
                      )}
                  </FormItem>
                  <FormItem
                      label="状态"
                      {...formItemLayout}
                  >
                      {getFieldDecorator('upConditions', {
                          rules: [],
                          initialValue: "0",
                      })(
                          <RadioGroup>
                              <Radio value="0">启用</Radio>
                              <Radio value="-1">禁用</Radio>
                          </RadioGroup>
                      )}
                  </FormItem>
              </Form>
          </Modal>
          {/* 查看用户详情模态框 */}
          <Modal
              title={this.state.nowData ? `${this.state.nowData.userName}的用户详情` : '用户详情'}
              visible={this.state.queryModalShow}
              onOk={() => this.onQueryModalClose()}
              onCancel={() => this.onQueryModalClose()}
          >
              <Form>
                  <FormItem
                      label="用户名"
                      {...formItemLayout}
                  >
                      {!!this.state.nowData ? this.state.nowData.userName : ''}
                  </FormItem>
                  <FormItem
                      label="性别"
                      {...formItemLayout}
                  >
                      {!!this.state.nowData ? (this.state.nowData.sex === 1 ? '男' : '女') : ''}
                  </FormItem>
                  <FormItem
                      label="年龄"
                      {...formItemLayout}
                  >
                      {!!this.state.nowData ? this.state.nowData.age : ''}
                  </FormItem>
                  <FormItem
                      label="电话"
                      {...formItemLayout}
                  >
                      {!!this.state.nowData ? this.state.nowData.phone : ''}
                  </FormItem>
                  <FormItem
                      label="邮箱"
                      {...formItemLayout}
                  >
                      {!!this.state.nowData ? this.state.nowData.email : ''}
                  </FormItem>
                  <FormItem
                      label="部门"
                      {...formItemLayout}
                  >
                      {!!this.state.nowData ? this.getNameForId(this.state.nowData.orgCode) : ''}
                  </FormItem>
                  <FormItem
                      label="描述"
                      {...formItemLayout}
                  >
                      {!!this.state.nowData ? this.state.nowData.description : ''}
                  </FormItem>
                  <FormItem
                      label="状态"
                      {...formItemLayout}
                  >
                      {!!this.state.nowData ? (this.state.nowData.conditions === "0" ? <span style={{ color: 'green' }}>启用</span> : <span style={{ color: 'red' }}>禁用</span>) : ''}
                  </FormItem>
              </Form>
          </Modal>
          {/* 修改用户角色模态框 */}
          <RoleTree
              userInfo={this.state.nowData}        // 当前操作用户信息
              roleData={this.props.allRoles}        // 所有的角色数据
              modalShow={this.state.roleTreeShow}  // 是否显示
              actions={this.props.actions}
              onOk={(arr) => this.onRoleTreeOk(arr)}
              onClose={() => this.onRoleTreeClose()}
          />
      </div>
    );
  }
}

// ==================
// PropTypes
// ==================

Manager.propTypes = {
  location: P.any,
  history: P.any,
  actions: P.any,
  allRoles: P.any,
  allOrganizer: P.any,
    citys: P.array,
};

// ==================
// Export
// ==================
const WrappedHorizontalManager = Form.create()(Manager);
export default connect(
  (state) => ({
    allRoles: state.sys.allRoles,
    allOrganizer: state.sys.allOrganizer,
    citys: state.sys.citys,
  }), 
  (dispatch) => ({
    actions: bindActionCreators({ findAdminUserByKeys, addAdminUserInfo, deleteAdminUserInfo, updateAdminUserInfo, findAllRole, findAllRoleByUserId, assigningRole, findAllOrganizer, findAllProvince, findCityOrCounty, findStationByArea }, dispatch),
  })
)(WrappedHorizontalManager);
